  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for DeSoto National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1962.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, vegetation control, and prescribed burns. A progress
  report on field investigations and applied research is also provided. Resource management
  is outlined; topics include timber removal. The public relations section of the
  report describes recreational uses, Refuge visitors, Refuge participation, violations,
  sport fishing, and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
